%                 h_array((obj.n_x*i+1):(obj.n_x*i+obj.n_x)) = y - z(i+2,1:obj.n_x);
%             end
            
            %
            h_array((obj.n_x*obj.N+1):(obj.n_x*obj.N+obj.n_psi)) = [  z(1,1)-obj.X_0(1),...
                                                                      z(1,2)-obj.X_0(2),...
                                                                      z(1,3)-obj.X_0(3),...
                                                                      z(1,4)-obj.X_0(4),...
                                                                    z(end,1)-obj.X_T(1),...
                                                                    z(end,2)-obj.X_T(2),...
                                                                                      0,...
                                                                                      0];
        end

        %% Funtion für fmincon
        % Nichtlineare Beschränkungen
        function [c,ceq] = nonlcon(obj,z)
            c = obj.G(z); 
            ceq = obj.H(z);
        end
